RT @Veaney_Arteaga: Ballot harvesting

2 minutes

@CarolynColson @AgustinLaje @PedroMCasals @Apolo_900 @jupero @ArchieFenster @nyclatinhunk…

@DanaWefer I looked up the 130k mystery votes you previously cited to me turned out to be “fake news”. Nothing more than a data entry mistake by Decision Desk HQ that was corrected shortly after.

Emerging info about ballot harvesting so far points towards Trump.

